INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(1, 'veg', '', 'Foreign', 'Paneer Butter Masala', 'Paneer Butter Masala is a rich and creamy North Indian dish made with\r\npaneer (Indian cottage cheese) cooked in a tomato-based gravy. It&#39;s a popular choice for\r\nvegetarians due to its luscious texture and flavorful spices, often enjoyed with naan or\r\nrice.', 'Recipe:\r\nIngredients:\r\n 200g paneer, cubed\r\n 2 tbsp butter\r\n 1 tbsp oil\r\n 1 large onion, finely chopped\r\n 2 tomatoes, pureed\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp garam masala\r\n 1 tsp coriander powder\r\n 1/2 tsp turmeric powder\r\n 1/2 tsp red chili powder\r\n 1/2 cup cream\r\n 1/4 cup water\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil and 1 tbsp butter in a pan. Add cumin seeds and let them splutter.\r\n2. Add finely chopped onions and saut until golden brown.\r\n3. Add ginger-garlic paste and saut for a minute until the raw smell disappears.\r\n4. Pour in the tomato puree and cook until the oil separates from the mixture.\r\n5. Add turmeric, red chili powder, coriander powder, and garam masala. Mix well.\r\n6. Add the paneer cubes and gently stir to coat them with the masala.\r\n7. Pour in the cream and water, stirring well. Cook for 5-7 minutes until the gravy thickens.\r\n8. Add salt to taste and the remaining butter. Mix and simmer for another 2-3 minutes.\r\n\r\n2\r\n\r\n9. Garnish with fresh coriander leaves and serve hot with naan or rice.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(2, 'Non-Veg', '', 'Foreign', 'Chicken Biryani', 'Chicken Biryani is a flavorful and aromatic rice dish that originated in the\r\nIndian subcontinent. It&#39;s made with marinated chicken, basmati rice, and a blend of\r\nspices, layered and cooked to perfection. Biryani is a festive favorite and a staple at\r\ncelebrations.', 'Recipe:\r\nIngredients:\r\n 500g chicken, cut into pieces\r\n 2 cups basmati rice, soaked for 30 minutes\r\n 2 large onions, thinly sliced\r\n 1 cup yogurt\r\n 2 tbsp biryani masala\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp red chili powder\r\n 4 green cardamoms\r\n 4 cloves\r\n 2 bay leaves\r\n 1 cinnamon stick\r\n 1/2 cup chopped mint leaves\r\n 1/2 cup chopped coriander leaves\r\n 1/4 cup ghee or oil\r\n Salt to taste\r\n Saffron strands soaked in 2 tbsp warm milk (optional)\r\nInstructions:\r\n1. Marinate the chicken with yogurt, ginger-garlic paste, turmeric, red chili powder, and\r\nbiryani masala. Let it rest for at least 1 hour.\r\n2. Cook the soaked rice in boiling salted water with bay leaves, cardamoms, cloves, and\r\ncinnamon until 70% cooked. Drain and set aside.\r\n\r\n3\r\n\r\n3. Heat ghee or oil in a large pot. Fry the sliced onions until golden brown and crispy.\r\nRemove half the onions and set aside for garnishing.\r\n4. In the same pot, add the marinated chicken and cook until the chicken is 80% done.\r\n5. Layer the partially cooked rice over the chicken. Sprinkle mint leaves, coriander leaves,\r\nand the reserved fried onions over the rice.\r\n6. Drizzle the saffron milk (if using) over the rice.\r\n7. Cover the pot with a tight-fitting lid or seal with aluminum foil. Cook on low heat (dum)\r\nfor 20-25 minutes.\r\n8. Remove from heat and let it rest for 10 minutes before opening the lid.\r\n9. Gently fluff the biryani with a fork and serve hot with raita or a side salad.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(3, 'Veg', '', 'Nepali', 'Aloo Gobi', 'A classic North Indian dish made with potatoes (aloo) and cauliflower\r\n(gobi), cooked with a blend of spices. It&#39;s a simple yet flavorful dish, often served with\r\nroti or rice.', 'Recipe: Ingredients:\r\n 2 large potatoes, peeled and diced\r\n 1 medium cauliflower, cut into florets\r\n 1 large onion, finely chopped\r\n 2 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp turmeric powder\r\n 1 tsp coriander powder\r\n 1 tsp garam masala\r\n 1/2 tsp red chili powder\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil in a pan and add cumin seeds.\r\n2. Add onions and saut until golden brown.\r\n\r\n4\r\n3. Add ginger-garlic paste and saut for a minute.\r\n4. Add tomatoes and cook until soft.\r\n5. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n6. Add potatoes and cauliflower. Mix to coat with the spices.\r\n7. Cover and cook on low heat until vegetables are tender.\r\n8. Sprinkle garam masala and mix.\r\n9. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(6, 'Veg', '', 'Nepali', 'Chana Masala', 'A popular North Indian curry made with chickpeas (chana) cooked in a\r\nspicy and tangy tomato-based gravy. It&#39;s a hearty dish often served with rice or naan.', 'Recipe: Ingredients:\r\n 2 cups boiled chickpeas\r\n 2 large onions, finely chopped\r\n 3 tomatoes, pureed\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp turmeric powder\r\n 1 tsp coriander powder\r\n 1 tsp garam masala\r\n 1/2 tsp red chili powder\r\n 1 tbsp chana masala powder\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil in a pan and add cumin seeds.\r\n2. Add onions and saut until golden brown.\r\n3. Add ginger-garlic paste and saut for a minute.\r\n4. Add tomato puree and cook until oil separates.\r\n5. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n6. Add chickpeas and chana masala powder. Mix to coat with the spices.\r\n7. Add water if needed and simmer for 10-15 minutes.\r\n8. Sprinkle garam masala and mix.\r\n\r\n5\r\n9. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(23, 'Non-Veg', '', 'Foreign', 'Butter Chicken', 'A rich and creamy North Indian dish made with marinated chicken cooked\r\nin a spiced tomato-based gravy, finished with butter and cream. Its a popular dish\r\nenjoyed with naan or rice.', 'Recipe: Ingredients:\r\n 500g chicken, cut into pieces\r\n 2 large onions, finely chopped\r\n\r\n8\r\n\r\n 3 tomatoes, pureed\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp turmeric powder\r\n 1 tsp coriander powder\r\n 1 tsp garam masala\r\n 1/2 tsp red chili powder\r\n 1/2 cup cream\r\n 3 tbsp butter\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Marinate the chicken with ginger-garlic paste, turmeric, red chili powder, and salt. Let it\r\nrest for at least 1 hour.\r\n2. Heat oil in a pan and add cumin seeds.\r\n3. Add onions and saut until golden brown.\r\n4. Add tomato puree and cook until oil separates.\r\n5. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n6. Add marinated chicken and cook until chicken is tender.\r\n7. Pour in the cream and cook for 5-7 minutes.\r\n8. Add butter and mix well.\r\n9. Sprinkle garam masala and mix.\r\n10. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(24, 'Non-Veg', '', 'Nepali', 'Fish Curry', 'A tangy and spicy fish curry made with fresh fish cooked in a coconut-\r\nbased gravy with a blend of spices. Its a popular coastal dish often served with steamed\r\nrice.', 'Recipe: Ingredients:\r\n 500g fish, cleaned and cut into pieces\r\n 2 large onions, finely chopped\r\n 3 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n\r\n9\r\n\r\n 1 tsp mustard seeds\r\n 1 tsp turmeric powder\r\n 1 tsp coriander powder\r\n 1/2 tsp red chili powder\r\n 1 cup coconut milk\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil in a pan and add mustard seeds.\r\n2. Add onions and saut until golden brown.\r\n3. Add ginger-garlic paste and saut for a minute.\r\n4. Add tomatoes and cook until soft.\r\n5. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n6. Add coconut milk and bring to a boil.\r\n7. Add fish pieces and cook until fish is tender.\r\n8. Cook for 5-7 minutes until flavors blend.\r\n9. Garnish with fresh coriander leaves and serve hot with rice.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(25, 'Veg', '', 'Nepali', 'Dal Bhat', 'Dal Bhat is a staple food of Nepal consisting of steamed rice (bhat) and\r\nlentil soup (dal). It&#39;s typically served with vegetable curries, pickles, and greens.', 'Recipe: Ingredients:\r\n 1 cup rice\r\n 1 cup split yellow lentils (moong dal)\r\n 1 large onion, finely chopped\r\n 2 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin seeds\r\n\r\n10\r\n\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Cook rice in a pot or rice cooker.\r\n2. Boil lentils with water, turmeric, and salt until soft.\r\n3. Heat oil in a pan and add cumin seeds.\r\n4. Add onions and saut until golden brown.\r\n5. Add ginger-garlic paste and tomatoes. Cook until tomatoes are soft.\r\n6. Add the cooked lentils to the pan and simmer for 5-7 minutes.\r\n7. Garnish with fresh coriander leaves and serve hot with rice.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(26, 'Veg', '', 'Nepali', 'Gundruk', 'Gundruk is a fermented leafy green vegetable, often served as a pickle or in\r\na soup. It&#39;s a traditional and unique part of Nepali cuisine, valued for its tangy flavor.', 'Recipe: Ingredients:\r\n 2 cups gundruk (fermented leafy greens)\r\n 1 large onion, finely chopped\r\n 2 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin seeds\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil in a pan and add cumin seeds.\r\n2. Add onions and saut until golden brown.\r\n3. Add ginger-garlic paste and tomatoes. Cook until tomatoes are soft.\r\n4. Add turmeric, salt, and gundruk. Mix well.\r\n5. Cook for 5-7 minutes until flavors blend.\r\n6. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(27, 'Veg', '', 'Nepali', 'Vegetable Momo', 'Vegetable Momo is a popular Nepali dumpling filled with a mixture of\r\nfinely chopped vegetables. It&#39;s a favorite street food, often served with spicy dipping\r\nsauce.', 'Recipe: Ingredients:\r\n 2 cups all-purpose flour\r\n 1 cup finely chopped mixed vegetables (cabbage, carrots, onions)\r\n 2 tbsp soy sauce\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin powder\r\n Salt to taste\r\n Water to knead dough\r\n Oil for cooking\r\nInstructions:\r\n1. Mix flour and water to form a smooth dough. Let it rest for 30 minutes.\r\n2. Heat oil in a pan and saut ginger-garlic paste.\r\n3. Add chopped vegetables, turmeric, cumin, soy sauce, and salt. Cook until vegetables are\r\ntender.\r\n4. Roll out small circles of dough, place a spoonful of filling in the center, and fold into\r\ndumplings.\r\n5. Steam momos for 10-12 minutes until cooked through.\r\n6. Serve hot with spicy dipping sauce.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(28, 'Non-Veg', '', 'Nepali', 'Chicken Curry (Nepali Style)', 'Nepali Chicken Curry is a flavorful and spicy dish made with marinated\r\nchicken cooked in a tomato-based gravy with traditional spices. It&#39;s commonly served\r\nwith rice or roti.', 'Recipe: Ingredients:\r\n 500g chicken, cut into pieces\r\n 2 large onions, finely chopped\r\n 3 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin seeds\r\n 1 tsp coriander powder\r\n 1/2 tsp garam masala\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Marinate the chicken with ginger-garlic paste, turmeric, and salt. Let it rest for at least 1\r\nhour.\r\n2. Heat oil in a pan and add cumin seeds.\r\n3. Add onions and saut until golden brown.\r\n4. Add tomatoes and cook until soft.\r\n5. Add marinated chicken and cook until chicken is tender.\r\n6. Add coriander powder and garam masala. Mix well.\r\n7. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(30, 'Non-Veg', '', 'Nepali', 'Goat Curry (Khasi Ko Masu)', 'Khasi Ko Masu is a traditional Nepali goat curry made with tender goat\r\nmeat cooked in a rich and spicy gravy. It&#39;s a festive favorite, often served with rice or roti.', 'Recipe: Ingredients:\r\n 500g goat meat, cut into pieces\r\n 2 large onions, finely chopped\r\n 3 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin seeds\r\n 1 tsp coriander powder\r\n 1/2 tsp garam masala\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n\r\n15\r\n\r\n1. Marinate the goat meat with ginger-garlic paste, turmeric, and salt. Let it rest for at\r\nleast 1 hour.\r\n2. Heat oil in a pan and add cumin seeds.\r\n3. Add onions and saut until golden brown.\r\n4. Add tomatoes and cook until soft.\r\n5. Add marinated goat meat and cook until meat is tender.\r\n6. Add coriander powder and garam masala. Mix well.\r\n7. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(31, 'Non-Veg', '', 'Nepali', 'Mutton Sekuwa', 'Mutton Sekuwa is a popular Nepali grilled meat dish made with marinated\r\nmutton. It&#39;s known for its juicy and flavorful taste, often enjoyed as a snack or appetizer.', 'Recipe: Ingredients:\r\n 500g mutton, cut into pieces\r\n 2 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin powder\r\n 1 tsp coriander powder\r\n 1 tsp chili powder\r\n 2 tbsp mustard oil\r\n Salt to taste\r\n Lemon wedges for garnish\r\nInstructions:\r\n1. Marinate the mutton with ginger-garlic paste, turmeric, cumin, coriander, chili powder,\r\nmustard oil, and salt. Let it rest for at least 2 hours.\r\n2. Skewer the marinated mutton and grill over medium heat until cooked through and\r\nslightly charred.\r\n3. Serve hot with lemon wedges.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(32, 'Non-Veg', '', 'Nepali', 'Fish Tarkaari', 'Fish Tarkaari is a traditional Nepali fish curry made with fresh fish cooked\r\nin a spiced tomato-based gravy. It&#39;s a popular dish often served with steamed rice.', 'Recipe: Ingredients:\r\n 500g fish, cleaned and cut into pieces\r\n 2 large onions, finely chopped\r\n 3 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp turmeric powder\r\n 1 tsp cumin seeds\r\n 1 tsp coriander powder\r\n 1/2 tsp red chili powder\r\n 1 cup coconut milk\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Heat oil in a pan and add cumin seeds.\r\n2. Add onions and saut until golden brown.\r\n3. Add ginger-garlic paste and tomatoes. Cook until tomatoes are soft.\r\n4. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n5. Add coconut milk and bring to a boil.\r\n6. Add fish pieces and cook until fish is tender.\r\n7. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(33, 'Veg', '', 'Foreign', 'Greek Salad (Greece)', 'Greek Salad is a vibrant salad featuring tomatoes, cucumbers, olives, and\r\nfeta cheese, tossed in a lemon-oregano dressing. Its a perfect side dish or light meal.', 'Recipe: Ingredients:\r\n 4 tomatoes, chopped\r\n 1 cucumber, sliced\r\n 1 red onion, thinly sliced\r\n 1 cup Kalamata olives\r\n 200g feta cheese, cubed\r\n 2 tbsp olive oil\r\n 1 tbsp lemon juice\r\n 1 tsp dried oregano\r\n Salt and pepper to taste\r\nInstructions:\r\n1. In a bowl, combine tomatoes, cucumber, onion, olives, and feta.\r\n2. In a small bowl, whisk together olive oil, lemon juice, oregano, salt, and pepper.\r\n3. Pour dressing over salad and toss gently. Serve immediately.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(34, 'Veg', '', 'Foreign', 'Falafel (Middle East)', 'Falafel is a popular Middle Eastern dish made from ground chickpeas and\r\nspices, formed into balls and deep-fried. Its often served in pita bread with vegetables\r\nand tahini sauce.', 'Recipe: Ingredients:\r\n 2 cups dried chickpeas, soaked overnight\r\n 1 onion, chopped\r\n 3 cloves garlic, minced\r\n 1 cup fresh parsley\r\n 1 tsp cumin powder\r\n 1 tsp coriander powder\r\n Salt and pepper to taste\r\n Oil for frying\r\nInstructions:\r\n\r\n19\r\n\r\n1. In a food processor, blend chickpeas, onion, garlic, parsley, cumin, coriander, salt, and\r\npepper until coarse.\r\n2. Form the mixture into small balls.\r\n3. Heat oil in a frying pan and fry falafel balls until golden brown.\r\n4. Drain on paper towels and serve hot with pita bread and tahini sauce.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(35, 'Non-Veg', '', 'Foreign', 'Teriyaki Chicken (Japan)', 'Teriyaki Chicken (Japan)', 'Recipe: Ingredients:\r\n 500g chicken thighs\r\n 1/4 cup soy sauce\r\n 1/4 cup mirin\r\n 2 tbsp sugar\r\n 1 tbsp sake\r\n 1 tsp ginger, grated\r\n\r\n21\r\n\r\n 1 tsp garlic, minced\r\n 1 tbsp vegetable oil\r\n Sesame seeds and chopped green onions for garnish\r\nInstructions:\r\n1. In a bowl, mix soy sauce, mirin, sugar, sake, ginger, and garlic.\r\n2. Heat oil in a pan and cook chicken until browned and cooked through.\r\n3. Add the teriyaki sauce to the pan and cook until the sauce thickens and coats the\r\nchicken.\r\n4. Garnish with sesame seeds and chopped green onions. Serve hot with steamed rice.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(36, 'Non-Veg', '', 'Foreign', 'Paella (Spain)', 'Paella is a traditional Spanish rice dish cooked with saffron, vegetables, and\r\na variety of proteins such as chicken, seafood, and chorizo. Its a vibrant and flavorful\r\none-pan meal.', 'Recipe: Ingredients:\r\n 1 cup short-grain rice\r\n 500g chicken, cut into pieces\r\n 200g shrimp, peeled and deveined\r\n 200g mussels, cleaned\r\n 1 red bell pepper, chopped\r\n 1 green bell pepper, chopped\r\n 1 onion, chopped\r\n 3 cloves garlic, minced\r\n 1 cup tomatoes, chopped\r\n 1 tsp smoked paprika\r\n 1/2 tsp saffron threads\r\n 3 cups chicken broth\r\n 2 tbsp olive oil\r\n Salt and pepper to taste\r\n Fresh parsley for garnish\r\nInstructions:\r\n1. Heat olive oil in a large paella pan or skillet. Cook chicken until browned and set aside.\r\n2. In the same pan, saut onions, garlic, and bell peppers until tender.\r\n\r\n22\r\n\r\n3. Add tomatoes, smoked paprika, and saffron. Cook for a few minutes.\r\n4. Stir in rice and chicken broth. Bring to a boil.\r\n5. Reduce heat and simmer for 15 minutes. Add chicken, shrimp, and mussels. Cook until\r\nseafood is done and liquid is absorbed.\r\n6. Garnish with fresh');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(37, 'Veg', '', 'Foreign', 'Baingan Bharta', 'A smoky and flavorful Punjabi dish made with roasted and mashed\r\neggplant (baingan) cooked with onions, tomatoes, and spices. Its a delicious dish often\r\nserved with roti or paratha.', 'Recipe: Ingredients:\r\n 1 large eggplant\r\n 2 large onions, finely chopped\r\n 3 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp turmeric powder\r\n 1 tsp coriander powder\r\n 1/2 tsp red chili powder\r\n 1/2 tsp garam masala\r\n 2 tbsp oil\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Roast the eggplant on an open flame until the skin is charred. Cool, peel, and mash.\r\n2. Heat oil in a pan and add cumin seeds.\r\n3. Add onions and saut until golden brown.\r\n4. Add ginger-garlic paste and saut for a minute.\r\n5. Add tomatoes and cook until soft.\r\n6. Add turmeric, coriander, red chili powder, and salt. Mix well.\r\n7. Add the mashed eggplant and mix to coat with the spices.\r\n8. Cook for 5-7 minutes until flavors blend.\r\n9. Sprinkle garam masala and mix.\r\n10. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(38, 'Veg', '', 'Foreign', 'Dal Tadka', 'A comforting and aromatic lentil dish made with yellow lentils (toor dal)\r\ncooked and tempered with ghee, cumin seeds, garlic, and spices. Its a staple in Indian\r\nhouseholds, often served with rice or roti.', 'Recipe: Ingredients:\r\n\r\n7\r\n\r\n 1 cup toor dal, rinsed\r\n 1 large onion, finely chopped\r\n 2 tomatoes, chopped\r\n 1 tbsp ginger-garlic paste\r\n 1 tsp cumin seeds\r\n 1 tsp turmeric powder\r\n 1/2 tsp red chili powder\r\n 1/2 tsp garam masala\r\n 2 tbsp ghee\r\n Salt to taste\r\n Fresh coriander leaves for garnish\r\nInstructions:\r\n1. Cook toor dal with water, turmeric, and salt until soft.\r\n2. Heat ghee in a pan and add cumin seeds.\r\n3. Add onions and saut until golden brown.\r\n4. Add ginger-garlic paste and saut for a minute.\r\n5. Add tomatoes and cook until soft.\r\n6. Add red chili powder and mix well.\r\n7. Pour the tempered mixture into the cooked dal and mix.\r\n8. Cook for 5-7 minutes until flavors blend.\r\n9. Sprinkle garam masala and mix.\r\n10. Garnish with fresh coriander leaves and serve hot.');
INSERT INTO `recipe_details` (`recipe_id`, `category`, `image`, `origin`, `recipe_name`, `recipe_description`, `recipe_preparation`) VALUES
(39, 'Veg', '', 'Nepali', 'Sel Roti', 'Sel Roti is a traditional Nepali fried bread made from rice flour. It is sweet\r\nand crispy, often prepared during festivals and special occasions.', 'Recipe: Ingredients:\r\n 2 cups rice flour\r\n 1 cup water\r\n 1/2 cup sugar\r\n\r\n12\r\n\r\n 1/4 cup milk\r\n 1 tbsp melted butter or ghee\r\n Oil for deep frying\r\nInstructions:\r\n1. Mix rice flour, water, sugar, milk, and melted butter to form a smooth batter.\r\n2. Heat oil in a deep frying pan.\r\n3. Pour batter in a circular shape into the hot oil using a piping bag or bottle.\r\n4. Fry until golden brown on both sides.\r\n5. Drain on paper towels and serve warm.');

